{"module":"form","request_type":["POST"],"service":"user"},{"module":"cloud-services","request_type":["POST","DELETE","GET","PUT","PATCH"],"service":"user"},{"module":"organization","request_type":["POST","GET"],"service":"user"},{"module":"entity-type","request_type":["POST"],"service":"user"},{"module":"entity","request_type":["GET"],"service":"user"},{"module":"account","request_type":["GET","POST"],"service":"user"},{"module":"user-role","request_type":["GET"],"service":"user"},{"module":"organization-feature","request_type":["GET"],"service":"user"}],"state":{"value":"6866477033a96f0013aa8361","label":"Karnataka","externalId":"karnataka"},"block":{"value":"687a2e28b19aea00144bcda0","label":"Ka My Block","externalId":"kaMyBlock"},"school":{"value":"687a2e50b19aea00144bcdac","label":"Government First Grade College for Women Vijayanagar","externalId":"KAMys007"},"district":{"value":"687a2e0bb19aea00144bcd9d","label":"Mysore","externalId":"mysore"},"cluster":{"value":"687a2e3cb19aea00144bcda3","label":"Ka My Cluster","externalId":"kaMyCluster"},"professional_role":{"value":"6881c20cb19aea00144bfae4","label":"Youth leader","externalId":"Youth_leader"},"professional_subroles":[{"value":"6881c237b19aea00144bfaed","label":"Youth leader","externalId":"youth_leader"}]},"userRoleInformation":{"tenantId":"shikshagrahanew","organizations":["karnataka"]},"appInformation":{},"story":{"title":"Improving School Attendance","objective":"To improve school attendance by addressing the reasons behind absenteeism and making learning more engaging","timeline":"","actionSteps":["Spoke to students to understand reasons for absenteeism","Met with parents to explain the importance of education","Helped students get school supplies through local donations","Organized fun learning sessions","Worked with teachers to make lessons more engaging","Followed up with parents to ensure regular attendance","Encouraged students by praising their efforts regularly"],"resources":[],"impact":"More students started attending school regularly and showed interest in learning, leading to a more positive environment","summary":"Sgcheck Mysuru, a youth leader, noticed that many students in their school didnt attend classes regularly. Some lacked motivation, and others had personal challenges at home. They decided to focus on this problem and started by speaking to the students and asking why they were not coming to school. Sgcheck met with their parents and explained the importance of education. They also helped them get school supplies through local donations and organized small fun learning sessions to make school interesting. \nSgcheck worked with teachers to make lessons more engaging, followed up with parents to ensure regular attendance, and encouraged students by praising their efforts regularly. They faced challenges such as low student interest, lack of parental support, and limited resources. To overcome these challenges, Sgcheck made activities more fun, conducted home visits to explain the importance of education, and reused old materials and took help from local groups. \nThe solution took 5 months to complete. Sgchecks school teacher and a few friends helped them. The teacher guided them on what to do, and their friends helped in talking to other students and organizing study sessions. Sgcheck noticed that more students started attending school regularly and showed interest in learning. The environment also became more positive.","authorName":"sgcheck","location":"Ka My Block, Mysore, Karnataka","conversation":[{"user":"\nMany students in our school didnt attend classes regularly. Some lacked motivation, and others had personal challenges at home.\n","timestamp":"2025-07-24 14:30:47"},{"bot":"It sounds like there are multiple problems here. To create a focused micro improvement report, can you share one problem to work on right now?","timestamp":"2025-07-24 14:30:49"},{"user":"no","timestamp":"2025-07-24 14:30:59"},{"bot":"What are the reasons for the problem?","timestamp":"2025-07-24 14:31:02"},{"user":"Some students had to help their parents at work, some didnt have proper school supplies, and others didnt feel interested in learning.","timestamp":"2025-07-24 14:31:35"},{"bot":"What steps did you take to solve the problem? Please explain each step in detail.","timestamp":"2025-07-24 14:31:37"},{"user":"I spoke to the students and asked why they were not coming to school.\n\nI met with their parents and explained the importance of education.\n\nI helped them get school supplies through local donations.\n\nI organized small fun learning sessions to make school interesting.\n","timestamp":"2025-07-24 14:32:06"},{"bot":"Thanks for sharing those. Are there any other steps you'd like to share?","timestamp":"2025-07-24 14:32:08"},{"user":"Yes, a few more small steps I took:\n\n* I worked with teachers to make lessons more engaging.\n* I followed up with parents to ensure regular attendance.\n* I encouraged students by praising their efforts regularly.\n\n","timestamp":"2025-07-24 14:32:37"},{"bot":"Thanks for sharing those. Are there any other steps you'd like to share?","timestamp":"2025-07-24 14:32:38"},{"user":"no","timestamp":"2025-07-24 14:32:44"},{"bot":"What challenges did you face while performing these tasks, and how did you overcome them?","timestamp":"2025-07-24 14:32:47"},{"user":"Low student interest  I made activities more fun to keep them engaged.\n\nLack of parental support  I conducted home visits to explain the importance of education.\n\nLimited resources  I reused old materials and took help from local groups.\n","timestamp":"2025-07-24 14:33:11"},{"bot":"How much time did it take to complete this solution?","timestamp":"2025-07-24 14:33:14"},{"user":"5 months","timestamp":"2025-07-24 14:33:23"},{"bot":"Who else worked with you on this, and what actions did they take?","timestamp":"2025-07-24 14:33:25"},{"user":"My school teacher and a few friends helped me. The teacher guided us on what to do, and my friends helped in talking to other students and organizing study sessions.\n","timestamp":"2025-07-24 14:33:50"},{"bot":"Did you notice any changes while doing this task?","timestamp":"2025-07-24 14:33:52"},{"user":"Yes, I noticed that more students started attending school regularly and showed interest in learning. The environment also became more positive.\n","timestamp":"2025-07-24 14:34:15"},{"bot":"Is there anything else youd like to share about your experience?","timestamp":"2025-07-24 14:34:17"},{"user":"no","timestamp":"2025-07-24 14:34:24"},{"bot":"Thank you! Im now creating your story of improvment based on what you shared.","timestamp":"2025-07-24 14:34:27"}],"chatHistory":[{"user":"\nMany students in our school didnt attend classes regularly. Some lacked motivation, and others had personal challenges at home.\n","timestamp":"2025-07-24 14:30:47","event":"STARTED"},{"bot":"It sounds like there are multiple problems here. To create a focused micro improvement report, can you share one problem to work on right now?","timestamp":"2025-07-24 14:30:49","event":"IN_PROGRESS"},{"user":"no","timestamp":"2025-07-24 14:30:59","event":"IN_PROGRESS"},{"bot":"What are the reasons for the problem?","timestamp":"2025-07-24 14:31:02","event":"IN_PROGRESS"},{"user":"Some students had to help their parents at work, some didnt have proper school supplies, and others didnt feel interested in learning.","timestamp":"2025-07-24 14:31:35","event":"IN_PROGRESS"},{"bot":"What steps did you take to solve the problem? Please explain each step in detail.","timestamp":"2025-07-24 14:31:37","event":"IN_PROGRESS"},{"user":"I spoke to the students and asked why they were not coming to school.\n\nI met with their parents and explained the importance of education.\n\nI helped them get school supplies through local donations.\n\nI organized small fun learning sessions to make school interesting.\n","timestamp":"2025-07-24 14:32:06","event":"IN_PROGRESS"},{"bot":"Thanks for sharing those. 